import React from 'react'

export const TransactionList = () => {
    return (
        <div>
            <h3>History</h3>
            <ul id="list" className="list">
                <li className="minus">
                    Cash <span>-Rp 50000</span> <button className="delete-btn">x</button>
                </li>
            </ul>
        </div>
    )
}
